import React from 'react';
import { Link } from 'react-router-dom';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

export const Stats = () => {
  return (
    <div>
      <header className="bg-gray-900 text-white py-4 px-6">
        <div className="flex items-center justify-between">
          <div className="flex items-center">
            <div className="mr-4">
              <AccountCircleIcon fontSize="large" />
            </div>
            <div>
              <h1 className="text-xl font-bold">김범서</h1>
              <p className="text-gray-400">beomseo1210@gmail.com</p>
            </div>
          </div>
          <div className="flex items-center space-x-4">
            <button className="bg-white font-medium text-black px-4 py-2 rounded">회원정보 수정</button>
            <button className="bg-white font-medium text-black px-4 py-2 rounded">로그아웃</button>
          </div>
        </div>
      </header>
    </div>
  );
};

export default Stats;
